  declarations: [
    AppComponent,

    HomeComponent,
         LoginVlasnikComponent,
         VlasnikComponent,
         DekoraterComponent,
         PraviLoginComponent,
         PromenaLozinkeComponent,
         AdministratorComponent,
         Admin2Component,
         FirmaComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    HttpClientModule,
    FormsModule,
    GoogleMapsModule,
    AgmCoreModule.forRoot({
      apiKey:'AIzaSyBV9f7_2iT-Ev-hpHKd4SlShEhJE-mRqqU'
